 SELECT ?m ?lat ?long (bif:st_distance(?geo, bif:st_point(4.297,52.0749)))
    WHERE{
   
    ?m geo:geometry ?geo.
?m a          yago:CapitalsInEurope ;
    ?m geo:lat ?lat.
    ?m geo:long ?long.
    FILTER (bif:st_intersects (?geo, bif:st_point(4.297,52.0749), 300))
    }
    LIMIT 500

SELECT ?m ?lat ?long (bif:st_distance(?geo, bif:st_point(4.297,52.0749)))
   WHERE{
  
   ?m geo:geometry ?geo.
   ?m ?b yago:Municipalities_of_South_Holland.
   
   }
   LIMIT 500

SELECT ?m
   WHERE{
  
   ?m geo:geometry ?geo.
   ?m ?b yago:Municipalities_of_South_Holland.
   
   }
   LIMIT 500

PREFIX foaf: <http://xmlns.com/foaf/0.1/>

SELECT DISTINCT ?name ?m ?thumbnail ?lat ?long
    WHERE{
   {
    ?m geo:geometry ?geo.
    ?m geo:lat ?lat.
    ?m geo:long ?long.
    ?m <http://dbpedia.org/ontology/thumbnail> ?thumbnail.
    }
UNION
{?m dbpprop:name ?name
 }   
    
	
    FILTER (bif:st_intersects (?geo, bif:st_point(6.59139, 53.2061), 3))
    }
    LIMIT 50000

